using Newtonsoft.Json;

namespace Producer
{
    public class QueueProcessor : IQueueProcessor
    {
        private readonly IEventHubHelper eventHubHelper;
        private const string data = "";

        public QueueProcessor(IEventHubHelper eventHubHelper)
        {
            this.eventHubHelper = eventHubHelper;
        }

        public async Task Start()
        {
            PayloadData payload = new()
            {
                Payload = data
            };

            while (true)
            {
                payload.Timestamp = DateTimeOffset.UtcNow.ToUnixTimeMilliseconds();
                await this.eventHubHelper.Send(JsonConvert.SerializeObject(payload));
                Thread.Sleep(3000);
            }
        }
    }
}

public class PayloadData
{
    public string? Payload { get; set; }
    public long Timestamp { get; set; }
}